import React, { Component } from 'react'
import { Button, Container, Form, Header, Icon, Input, Segment } from 'semantic-ui-react';

class Login extends Component{
    render() {
        return (
            <Segment textAlign='center' vertical className='login-container'>
                <Header inverted as='h1' icon>
                    <Icon name='sign-in' />
                    LOGIN
                    <Header.Subheader>
                        Atur halaman desalase.id
                    </Header.Subheader>
                </Header>
                <Container>
                    <Form>
                        <Form.Field>
                            <Input icon='users' iconPosition='left' placeholder='username' />
                        </Form.Field>
                        <Form.Field>
                            <Input icon='key' iconPosition='left' placeholder='password' />
                        </Form.Field>
                        <Button type='submit'>Masuk</Button>
                    </Form>
                </Container>
            </Segment>
        );
    }
}

export default Login;
